import React from "react";

const NavBar = () => {
  return (
    <nav class="navbar navbar-light bg-light justify-content-between">
      <a class="navbar-brand">SmartOffice</a>

      <form class="form-inline">
        <button class="btn btn-outline-success my-2 my-sm-0 m-2" type="submit">
          <img src="./Images/notif-icon.png" width="5" heigth="5" />
        </button>
        <input
          class="form-control mr-sm-2"
          type="search"
          placeholder="Search"
          aria-label="Search"
        />
      </form>
    </nav>
  );
};

export default NavBar;
